import React, { Component } from 'react';
import { searchAllModels } from './services/apiService';
import './App.css';

class App extends Component {
    constructor() {
        super();
        this.state = {
            error: undefined,
            isLoaded: false,
            models: {
                cursors: {},
                next: undefined,
                previous: null,
                results: []
            }
        };
    }
    componentDidMount() {
        searchAllModels()
            .then((searchResponse) => {
                this.setState({
                    isLoaded: true,
                    models: searchResponse
                });
            });
    }
    render() {
        const { error, isLoaded, models } = this.state;

        return (
            <div className="App">
                <header className="App-header">
                    <img
                        src={"https://static.sketchfab.com/img/press/logos/logo.png"}
                        className="App-logo"
                        alt="logo"
                    />
                    <p>
                        Welcome to the <code>Tech/Frontend</code> exercise.
                    </p>
                    <div>
                        <ul>
                            {models.results.map(result => (
                                <li key={result.uid}>
                                    {result.name}
                                </li>
                            ))}
                        </ul>         
                    </div>
                </header>
            </div>
        );
    }
}

export default App;
